import React, { useState } from "react";

import "./SearchPost.css";

const SearchPost = () => {
  const [searchToggle, setSearchToggle] = useState("show");

  return (
    <div
      className="searchPostContainer"
      onClick={() => setSearchToggle("none")}
      style={{ display: searchToggle }}
    >
      <button className="searchOffBtn">닫기</button>
      <input type="text" />
      <div>입력 후 엔터를 눌러주세요</div>
    </div>
  );
};

export default SearchPost;
